import React from 'react'

export default function Home() {
    return (
        <div className='mt-5 d-flex'>
            <div className='text'>
                <h1>Welcome to Book House Store</h1>
                <p>Book House menyediakan buku buku yang berkualitas dan sangat best seller</p>
            </div>
        </div>
    )
}
